package gmibank.pages;import gmibank.utilities.Driver;import org.openqa.selenium.WebElement;import org.openqa.selenium.support.FindBy;import org.openqa.selenium.support.PageFactory;public class US_11_Page {    public US_11_Page() {        PageFactory.initElements(Driver.getDriver(),this);    }    @FindBy(id = "jh-create-entity")    public WebElement createNewCustomer;    @FindBy(id = "tp-customer-createDate")    public WebElement createDateCustomer;    @FindBy (id = "tp-customer-user")    public WebElement userDropdown;    @FindBy (id = "tp-customer-account")    public WebElement accountDropdown;    @FindBy (id = "tp-customer-zelleEnrolled")    public WebElement zelleEnrolledCheckBox;    @FindBy(id="save-entity")    public WebElement saveButton;    @FindBy(xpath = "//*[.='employee employee']")    public WebElement exitArea;    @FindBy(xpath = "//*[.='Sign out']")    public WebElement SignOut;}